import React from "react";
import PropTypes from "prop-types";

import "./Product.scss";

Product.propTypes = {};

function Product(props) {
  return (
    <div className="Product">
      <div className="Left">Product</div>
      <div className="Right">Product</div>
    </div>
  );
}

export default Product;
